import React from 'react'
import { Link } from 'react-router-dom'

const ProfileTop = ({profile : {
    status,
    company,
    location,
    website,
    social,
    user:{name,avatar}
}}) => {
    return (
        <div className="profile-top bg-primary p-2">
          <img
         className="round-img my-1"
            src={avatar}
            alt=""
          />
          <h1 className="large">{name}</h1>
          <p className="lead">{status} {company && <span>at {company}</span> }</p>
          <p>{location && <span>{location}</span>}</p>
          <div className="icons my-1">

            {
                website && (
                    <a  href={website} target="_blank"  >
              <i className="fas fa-globe fa-2x"> Website</i>
            </a>
                )
            }
            {
                social && social.twitter && (
                    <a href={"https://"+social.twitter} target="_b" rel="noopener noreferrer">
              <i className="fab fa-twitter fa-2x">Twitter</i>
            </a>
                )
            }
            {
                social && social.facebook && (
                    <a href={social.facebook} target="_b" rel="noopener noreferrer">
              <i className="fab fa-facebook fa-2x"> Facebook</i>
            </a>
                )
            }

            {
                social && social.linkedin && (
                    <a href={social.linkedin} target="_b" rel="noopener noreferrer">
              <i className="fab fa-linkedin fa-2x"> LinkedIn</i>
            </a>
                )
            }
            {
                social && social.youtube && (
                    <a href={social.youtube} target="_b" rel="noopener noreferrer">
              <i className="fab fa-youtube fa-2x"> Youtube</i>
            </a>
                )
            }
            {
                social && social.instagram && (
                    <a href={social.instagram} target="_b" rel="noopener noreferrer">
              <i className="fab fa-instagram fa-2x"> Instagram</i>
            </a>
                )
            }
            
          </div>
        </div>
    )
}

export default ProfileTop
